import './App.css';
import React, { Component } from 'react';
//import Header from './components/header/header'

class App extends Component {
  render() {
    return (
      <div>
        <Header />

	          <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
	  </div>
    );
  }
}

export default App;
